	<style>   
		#headerWrapper {   
			height: fit-content;   
			position: -webkit-sticky;   
			position: sticky;   
			top: 0;   
			display: grid;   
			/* To keep the header on top of the plate */   
			z-index: 1;   
		}   

		#headerBackgroundBox {   
			background-color: rgb(46, 46, 46);   
			margin: auto;   
			padding: 10px 20px;

			#headerBackgroundBox {

			}

		#headerTextBox {

			justify-content: center;

		}   
		@media (max-width: 520px) {   
			#headerTextBox {   
				display: block;   
			}   
		}    

		.headerText {   
			display: flex;   
			justify-content: center;   
			align-items: center;   
			white-space: nowrap;   
			font-size: 20px;   
			color: rgb(220, 220, 220);   
			padding: 0px 5px;   
		}   

		#plateKey {   
			display: flex;   
			justify-content: center;   
			max-width: 480px;   
			height: 30px;   
			margin: 5px 0px;   
		}   
		@media (max-width: 599px) {   
			#plateKey {   
				justify-content: space-around;   
			}   
		}   

		.keyItem {   
			display: flex;   
			justify-content: center;   
			align-items: center;   
			margin: 0px 20px;   
		}   
		@media (max-width: 599px) {   
			.keyItem {   
				margin: 0px 0px;   
			}   
		}   

		.keyDot {   
			min-width: 20px;   
			min-height: 30px;   
		}   

		.keyText {   
			padding-left: 10px;   
			padding-right: 10px;   
			color: rgb(220, 220, 220);   
		}   

		#plateButtonBox {   
			display: flex;   
			justify-content: center;   
			padding-top: 5px;   
		}   
		@media (max-width: 599px) {   
			#plateButtonBox {   
				justify-content: space-around;   
			}   
		}   

		.plateButton {   
			margin: 0px 20px;   
			background-color: lightgray;   
			border-radius: 8px;   
		}   
		@media (max-width: 599px) {   
			.plateButton {   
				margin: 0px 0px;   
			}   
		}   
		#plateNumberDisplayWrapper {   
			height: 0;   
		}

	<script>   
	//If you want to run scripts from the plateScripts.js file, you will also probably need to move all your scripts from here to the plateScript.js file.   
	//Trying to use scripts both in the html and the plateScripts.js file causes jquery reference errors because things won't load in the correct order.   

		// Changes height of #svgImage on screen resize (and page load) so that the svg doesn't overflow   
		$(window).resize(function() {   
			$('#svgImage').height((visualViewport.height - $('#headerWrapper').height()));   
		}).resize();   

		// Changes height of #OpenSeaDragonWrapper on screen resize (and page load) so that the image doesn't overflow   
		$(window).resize(function() {   
			$('#openSeaDragonWrapper').height((visualViewport.height - $('#headerWrapper').height()) -20);   
		}).resize();   

		// panzoom reset logic   
		// Commented out because the OpenSeaDragon library is being used instead.   
		//$('#plateResetPanZoomButton').click(function() {   
			//panzoom.reset();   
		//});   

		// Plate flipping logic   
		$('#plateFlipButton').click(function() {   

			// Triggers a plate reset so that the flip animates   
			// Commented out because the OpenSeaDragon library is being used instead.   
			//panzoom.reset();   

			// Does the flipping and highlights button   
			if($('#svgWrapper').hasClass('plateflipped')) {   
				$('#svgWrapper').removeClass('plateflipped');   
				$('#plateFlipButton').css('background-color', 'lightgray');   
			}   
			else {   
				$('#svgWrapper').addClass('plateflipped');   
				$('#plateFlipButton').css('background-color', 'rgb(134, 134, 134)');   
			}   

		});   

		// Plate background image logic   
		$('#backgroundImageButton').click(function() {   

			// Turns on the skyImage background and hilights button   
			if($('#skyImageBox').hasClass('skyImageOn')) {   
				$('#skyImageBox').removeClass('skyImageOn');   
				$('#skyImageBox').hide();   
				$('#backgroundImageButton').css('background-color', 'lightgray');   
			}   
			// Turns off the skyImage background and un-hilights button   
			else {   
				$('#skyImageBox').addClass('skyImageOn');   
				$('#skyImageBox').show();   
				$('#backgroundImageButton').css('background-color', 'rgb(134, 134, 134)');   
			}   

			// turns off the plate fill (so that it doesn't cover the skyImage background)   
			if ($('#backgroundFill').hasClass('fillOn')) {   
				$('#backgroundFill').removeClass('fillOn')   
				$('#backgroundFill').hide();   
			}   
			// turns on the plate fill   
			else {   
				$('#backgroundFill').addClass('fillOn')   
				$('#backgroundFill').show();   
			}   

		});   

		// Commented out because the OpenSeaDragon library is being used instead.   
		// panzoom library settings   
		//const element = document.getElementById('svgWrapper');   
		//const panzoom = Panzoom(element, {   
			//// options here   
			//maxScale: 50,   
			//minScale: .75,   
			//step: 2,   
			////determines how the transorms function.   
			//setTransform: (_, { scale, x, y }) => {   
				////You need a different setStyle property depending on if you flip the plate or not.   
				//if($('#svgWrapper').hasClass('plateflipped')){   
					//// If you put `-${x}` into the translate property below, you can not pan the svg into negative x values.   
					////Instead you must calculate the negative value of x before pluggin it in.   
					//let negativeX = -x;   
					//panzoom.setStyle('transform', `scale(-${scale},${scale}) translate(${negativeX}px, ${y}px)`)   
				//}   
				//else {   
					//panzoom.setStyle('transform', `scale(${scale},${scale}) translate(${x}px, ${y}px)`)   
				//}   
			//}   
		//});   

		// Commented out because the OpenSeaDragon library is being used instead.   
		//// enable mouse wheel   
		//const parent = element.parentElement;   
		//parent.addEventListener('wheel', panzoom.zoomWithWheel);   

		var viewer = OpenSeadragon({   
			id: 'openSeaDragonWrapper',   
			prefixUrl: '../openseadragon/images/',   
			defaultZoomLevel: 0,   
			preload: true,   
			immediateRender: true,   
			homeButton: 'plateResetPanZoomButton',   
			flipButton: 'plateFlipButton',   
			showFlipControl: true,   
			showRotationControl: true,   
			//showNavigator: true,   
			// Degrees set to != 0 to prevent bug -- Where while the tiled image is flipped,   
			// if you zoom in beyond the max pixel ratio (maxZoomPixelRation) of 1.1,   
			// the tiled image flips back to its original orientation.   
			degrees: .000001,   
			maxZoomPixelRatio: 4,   
			zoomPerScroll: 2,   
			tileSources: [   
				{   
					width: 4000,   
					tileSource: {   
						//required   
						type: 'zoomifytileservice',   
						width: 2048,   
						height: 2048,   
						tilesUrl:   
							'../assets/Zoomify_Images-8.05-2048/11386/',   
						//optional   
						tileSize: 256,   
						fileFormat: 'jpg'   
					},   
				},   
			],   
		});   

		var overlay = viewer.svgOverlay();   
		overlay.node().append(svgImage)   

		new OpenSeadragon.MouseTracker({   
			element: overlay._node,   
			clickHandler: function(event) {   
				var target = event.originalTarget.parentNode;   
				if (target.matches('a')) {   
					if (target.getAttribute('target') === '_blank') {   
						window.open(target.getAttribute('href'));   
					} else {   
						location.href = target.getAttribute('href');   
					}   
 				}   
 			}   
 		});   
 
		// jQuery UI slider scripts   
		$('#slider').slider({   
			// min and max values can not be 0 or 360 or an OpenSeadragon bug is triggered where the tile image flips when zooming in past a maxZoomPixelRation of 1.1   
			min: 0.000001,   
			max: 359.999999,   
			step: .000001   
		});   
 
		//This edits the size and placement of the slider handle.  Doing it in the styles doesn't seem to work.   
		$('.ui-slider-handle')   
			.height(30)   
			.width(70)   
			.css('margin-left', '-35px')   
			.css('margin-top', '3px')   
			.text('Rotate')   
			.css('color', 'lightgray');   
 
		// Sets the rotation angle of the SVG to that of the value of the slider   
		$('#slider').slider({slide: function(event, ui) {   
				viewer.viewport.setRotation(ui.value);   
				console.log('jQuery Script', ui.value)   
			}   
		});   
 
	</script>
